// const App = <h1>A ver:{prueba(element.name,element.type)}</h1>;
const App = () => (
    <div>
        <button onClick={TarjetaAnime.AddPB}>21 Marzo</button>
        <TarjetaAnime name={animes.name} type={animes.type} studio={animes.studio}/>
        <TarjetaAnime name={'Dead Note'} type={'Seinen'} studio={'MadHouse'}/>
    </div>
);

export default App
